// src/cull.ts
var gl = {
  BACK: 1029,
  FRONT: 1028
};
function getCullFace(mapVersion) {
  switch (mapVersion) {
    case "GAODE1.x":
      return gl.BACK;
      break;
    case "GAODE2.x":
      return gl.BACK;
      break;
    case "MAPBOX":
      return gl.FRONT;
      break;
    case "SIMPLE":
      return gl.FRONT;
      break;
    case "GLOBEL":
      return gl.BACK;
      break;
    case "DEBAULT":
      return gl.FRONT;
      break;
    default:
      return gl.FRONT;
  }
}
export {
  getCullFace
};
